function A = openUbitrack2DPositionList( filename )
D=2;
fid = fopen( filename );
%tline = fgetl( fid );
%N = sscanf( tline, '%*d%*s%*d%*d%*d%*f%*d%*d%d%*d')
N = fscanf( fid, '22 serialization::archive 9 0 0 %*f 0 0 %d 0 0 0 ',1);
A = fscanf( fid, '%f%f%f');
A=reshape(A,D,N);
fclose( fid );

